Cracking Simulator simulates the cracking system present at the MTA's server SAES:RPG.




Enters numbers;


Checks if the number entered is lower/higher than the crack number;


Deletes the last number entered;


Generates a new number ONLY when the last number has been cracked.

The option "View number" allows the user to see the crack number BUT, in order to
distinguish which crack has had that option enabled, a small verification under the
keyboard has been added.
